# -*- coding: utf-8 -*-from log import logfrom symbref import SymbolReferencesclass EnigmaOcr():    """Ouais bon, c'est pas du tout de l'OCR, mais fallait bien que je trouve    un nom. non de non."""        def __init__(self):        symbole_references = SymbolReferences()                def ocrify_enigma(self, list_symbol_before, rgb_big_op, list_symbol_after):        for symb in list_symbol_before:            log(symb)        log(rgb_big_op)        for symb in list_symbol_after:            log(symb)    